import './App.css';
import { Routes, Route } from "react-router-dom";

import { Header } from './components/Header'
import { HomePage } from "./pages/HomePage";
import { RegisterPage } from "./pages/RegisterPage";
import { LoginPage } from "./pages/LoginPage";
import { UserPage } from "./pages/UserPage";
import { NotFoundPage } from "./pages/NotFoundPage";
import { NewServicePage } from "./pages/NewServicePage";
import { ListServicesPage } from "./pages/ListServicesPage";


import { ServicePage } from "./pages/ServicePage";
import { Footer } from './components/Footer';



function App() {
  return (

    <main>
      <Header />
      <Routes>
        <Route path="/" element={<HomePage />} />
        <Route path="/register" element={<RegisterPage />} />
        <Route path="/login" element={<LoginPage />} />
        <Route path="/myuser" element={<UserPage />} />
        <Route path="/profiles/:username" element={<UserPage />} />
        <Route path="/newservice" element={<NewServicePage />} />
        <Route path="/services" element={<ListServicesPage />} />
        <Route path="/services/:id" element={<ServicePage />} />
        <Route path="*" element={<NotFoundPage />} />
      </Routes>
      <Footer />
    </main>
  );
}

export default App;
